;;;;; System design ;;;;;
;
; Data stack:
;   - Growing up from d_stack_base
;   - NoS pointed to by ebp
;   - ToS in eax
;   - Macros `pushd` and `popd` push and pop *below ToS*
;
; Return stack:
;   - Hardware stack
;   - Growing down from 0x80000
;   - Pointed to by esp
;   - Commands `push` and `pop` perform `>r` and `r>`
;
; Stacks share space, grow towards each other.
;
;
; Dictionary:
;  - Growing up from DICT_START
;  - Next free cell pointed to by `here`
;  - Macro `comma` expects `here` in edx and leaves updated `here` in edx


; Less/Greater -> signed
; Above/Below -> unsigned


;;;;; Macros ;;;;;

%macro pushd 0-1 eax
    add ebp, 4
    mov dword [ebp], %1
%endmacro

%macro popd 0-1 eax
    mov dword %1, [ebp]
    sub ebp, 4
%endmacro

%assign DICT_START 0x100000

%macro comma 0-2 eax, 4 ; Expects [here] in edx, leaves [here] in edx
    %ifn %2 - 1
        mov byte [edx], %1
    %elifn %2 - 2
        mov word [edx], %1
    %elifn %2 - 4
        mov dword [edx], %1
    %else
        %error %2 is not a valid word size for comma
    %endif
    add edx, %2
%endmacro


;;;;; Bootloader ;;;;;

section .bootloader vstart=0x7c00

BITS 16

    jmp start
times 0x3e - ($ - $$) db 0


start:
    ; 1. Load the boot?
    cld
    mov ax, 0       ; Reset segment registers
    mov ds, ax
    mov es, ax
    mov ss, ax
    mov sp, 0       ; setup hardware stack
    mov ah, 0x02    ; Function: Read Sectors From Drive
    mov al, (d_stack_base - payload_data_start) / 0x200 + 1 ; !! sector count !!
    mov ch, 0       ; cylinder (actually top 8 bits)
    mov cl, 2       ; sector (actually bottom 4 (2?) bits of cylinder
                    ; && 6 bits of sector)
    mov dh, 0       ; head
    mov bx, 0x500   ; destination addess
    int 0x13
    mov [disk_id_something], dl ; Save the disk id something
    mov ax, 0x0003  ; video mode 80x25
    int 0x10

    ; 1.5. Get disk geometry
    mov ah, 8
    int 0x13
    mov [heads], dh
    mov dh, cl
    and cl, 0x3F
    mov [sectors], cl
    mov cl, ch
    shr dh, 6
    mov ch, dh
    mov [cylinders], cx

    ; 2. Disable interrupts
    cli

    ; 3. Enable A20 line :dread:
    ; QEMU does that for me probably, so leave it for later

    ; 4. Make the GDT
    lgdt [gdtr]

    ; 5. Switch to 32b

    mov eax,cr0
    or al,1
    mov cr0,eax
    jmp 8:protected_start

BITS 32
protected_start:
    mov ax, 16
    mov ds, ax
    mov es, ax
    mov ss, ax


    ; 6. Make the IDT
    lidt [idtr]

    ; 7. Initialise the PICs
    mov esp, 0x80000            ; Setup return stack
    call program_pci

    ; 9. Profit
    sti
    mov ebp, d_stack_base - 4   ; Setup data stack with two values on top
    jmp test


%assign PIC1_COMMAND    0x20
%assign PIC1_DATA       0x21
%assign PIC1_OFFSET     0x20
%assign PIC2_COMMAND    0xa0
%assign PIC2_DATA       0xa1
%assign PIC2_OFFSET     0x28

%assign ICW1_INIT   0x10
%assign ICW1_ICW4   0x01
%assign ICW4_8086   0x01

    ; Potentially do some waiting between requests maybe???

program_pci:

    mov al, ICW1_INIT | ICW1_ICW4   ; Initialise setup
    out PIC1_COMMAND, al
    out PIC2_COMMAND, al
    mov al, PIC1_OFFSET             ; Set offsets
    out PIC1_DATA, al
    mov al, PIC2_OFFSET
    out PIC2_DATA, al
    mov al, 4                       ; PIC1 has a slave on line 2
    out PIC1_DATA, al
    mov al, 2                       ; PIC2 is a slave on line 2
    out PIC2_DATA, al
    mov al, ICW4_8086               ; Set both to 8086 mode
    out PIC1_DATA, al
    out PIC2_DATA, al

    mov al, 0b11111100  ; Only enable the keyboard and timer interrupts
    out PIC1_DATA, al
    mov al, 0b11111111
    out PIC2_DATA, al
    ret


times 510 - ($ - $$) db 0
db 0x55, 0xaa


;;;;; Payload ;;;;;

section .payload vstart=0x500
payload_data_start:


;;;;; Descriptor tables ;;;;;

; Global Descriptor Table

%assign GDT_PRESENT     0b10000000
%assign GDT_MEMORY      0b00010000
%assign GDT_CODE        0b00001000
%assign GDT_READABLE    0b00000010
%assign GDT_WRITABLE    0b00000010

%assign GDT_32BIT   0b0100
%assign GDT_PAGE    0b1000

%macro gdt_entry 4  ; Base, limit, access, flags
    dw (%2) & 0xffff
    dw (%1) & 0xffff
    db ((%1) & 0xff0000) >> 16
    db (%3)
    db (((%2) & 0xf0000) >> 16) | ((%4) << 4)
    db ((%1) & 0xff000000) >> 24
%endmacro


gdt:
    gdt_entry 0, 0, 0, 0
    gdt_entry 0, 0xfffff, GDT_PRESENT | GDT_MEMORY | GDT_CODE | GDT_READABLE, \
              GDT_32BIT | GDT_PAGE
    gdt_entry 0, 0xfffff, GDT_PRESENT | GDT_MEMORY            | GDT_WRITABLE, \
              GDT_32BIT | GDT_PAGE

gdtr:
    dw $ - gdt - 1
    dd gdt


gdt16:
    gdt_entry 0, 0, 0, 0
    gdt_entry 0, 0xfffff, GDT_PRESENT | GDT_MEMORY | GDT_CODE | GDT_READABLE, 0
    gdt_entry 0, 0xfffff, GDT_PRESENT | GDT_MEMORY            | GDT_WRITABLE, 0


gdtr16:
    dw $ - gdt16 - 1
    dd gdt16


disk_id_something:
    db 0


; Interrupt Descriptor Table

%assign IDT_TRAP32      0xf
%assign IDT_INTERRUPT32 0xe

%assign IDT_PRESENT 0b1000

%macro idt_entry 4 ; Offset, selector, type, flags
    dw (%1 - payload_data_start + 0x500) & 0xffff
    dw (%2)
    db 0
    db (%3) | ((%4) << 4)
    dw ((%1 - payload_data_start + 0x500) & 0xffff0000) >> 16
%endmacro

idt:
    ; Exception """handling"""
    %assign i 0
    %rep 0x20
        idt_entry exception_handler_%+i, 8, IDT_TRAP32, IDT_PRESENT
        %assign i i+1
    %endrep
    ; IRQ """handling"""
    idt_entry timer_interrupt, 8, IDT_INTERRUPT32, IDT_PRESENT
    idt_entry keyboard_interrupt, 8, IDT_INTERRUPT32, IDT_PRESENT
    %rep 0xe
        idt_entry die, 8, IDT_INTERRUPT32, IDT_PRESENT
    %endrep

idtr:
    dw $ - idt - 1
    dd idt


idtr16:
    dw 0x3FF
    dd 0


;;;;; Interrupt processing ;;;;;

%assign PIC_EOI 0x20

%macro end_of_master_interrupt 0
    mov al, PIC_EOI
    out PIC1_COMMAND, al
%endmacro

%macro end_of_slave_interrupt 0
    mov al, PIC_EOI
    out PIC1_COMMAND, al
    out PIC1_COMMAND, al
%endmacro


hardware_exception_msg:
    db "Hardware exception nr"
    %strlen hardware_exception_msg_len "Hardware exception nr"



%macro exc_handler 1
    exception_handler_%1:
        pushd
        mov eax, %1
        jmp generic_exception_handler
%endmacro


; exception "handlers"

generic_exception_handler:
    pushd
    pushd hardware_exception_msg
    mov eax, hardware_exception_msg_len
    call body_nl
    call body_type
    call body_print_number
    call body_nl
    jmp body_abort

%assign i 0
%rep 0x20
    exc_handler i
    %assign i i + 1
%endrep


timer_interrupt:
    add dword [timer_counter], 1
    push eax
    end_of_master_interrupt
    pop eax
    iret


; Key mapping:
; 0X:  INV ESC  1   2   3   4   5   6   7   8   9   0   -   =  BSP TAB
; 1X:   q   w   e   r   t   y   u   i   o   p   [   ]  RET CTL  a   s
; 2X:   d   f   g   h   j   k   l   ;   '   `  SHL  \   z   x   c   v
; 3X:   b   n   m   ,   .   /  SHR NM* ALL ' ' CPS F1  F2  F3  F4  F5
; 4X:  F6  F7  F8  F9  F10 NML SCL NM7 NM8 NM9 NM- NM4 NM5 NM6 NM+ NM1
; 5X:  NM2 NM3 NM0 NM.  X   X   X  F11 F12  X   X   X   X   X   X   X
; 6X:   X   X   X   X   X   X   X   X   X   X   X   X   X   X   X   X
; 7X:   X   X   X   X   X   X   X   X   X   X   X   X   X   X   X   X

keyboard_interrupt:
    pushad
    mov dx, 0x3f8
    mov al, 'K'
    out dx, al
    mov eax, 0
    in al, 0x60
    movzx ebx, byte [.state]
    jmp [ebx+.jump_table]

.default:
    cmp al, 0xe0
    je .double
    cmp al, 0xe1
    je .triple
    mov [last_ekey], al
    cmp al, 0x80
    jae .release

.press:
    mov byte [eax+keys], -1
    mov byte [eax+pressed], -1
    jmp .ret

.release:
    and eax, 0x7f
    mov byte [eax+keys], 0
    jmp .ret

.double:
    mov byte [.state], 4
    jmp .ret

.triple:
    mov byte [.state], 8
    jmp .ret

.two_of_two:
    mov byte [.state], 0
    jmp .ret

.two_of_three:
    mov byte [.state], 12
    jmp .ret

.three_of_three:
    mov byte [.state], 0

.ret:
    end_of_master_interrupt
    popad
    iret

.state: db 0
.jump_table:
    dd .default         ; 0
    dd .two_of_two      ; 4
    dd .two_of_three    ; 8
    dd .three_of_three  ; 12


;;;;; Assembly helpers ;;;;;

%assign VGA_START   0x0B8000
%assign VGA_WIDTH   80
%assign VGA_HEIGHT  25
%assign VGA_SIZE    VGA_WIDTH * VGA_HEIGHT


emit_raw:   ; Input ax = color | character, modifies ebx, ecx, esi, edi
    call scroll_to_cursor
    mov [VGA_START+ebx*2], ax
    inc ebx
    mov [cursor], ebx
    ret


scroll_to_cursor:   ; Modifies ebx, ecx, esi, edi. Leaves cursor in ebx.
    mov ebx, [cursor]


.keep_scrolling:
    cmp ebx, VGA_SIZE
    jl .return
    call scroll_up
    sub ebx, VGA_WIDTH
    jmp .keep_scrolling


.return:
    mov [cursor], ebx
    ret


scroll_up:  ; Modfies ecx, esi, edi
    mov ecx, VGA_SIZE
    mov esi, VGA_START + VGA_WIDTH * 2
    mov edi, VGA_START
    rep movsw
    ret


update_cursor:  ; Modifies ax, bx, dx
    mov bx, [cursor]

    mov dx, 0x03D4  ; Send lower cursor byte
    mov al, 0x0F
    out dx, al

    inc dl
    mov al, bl
    out dx, al

    dec dl          ; Send upper cursor byte
    mov al, 0x0E
    out dx, al

    inc dl
    mov al, bh
    out dx, al
    ret


; TODO: make it use base
print_number:   ; Takes number in eax, modifies eax, ebx, ecx, esi, edi
    push eax
    shr eax, 4
    cmp eax, 0
    je .no_recurse
    call print_number

.no_recurse:
    pop eax
    and eax, 0xf
    cmp eax, 0xa
    jl .just_decimal
    add eax, 7
.just_decimal:
    add eax, 0x30
    or eax, [color]
    jmp emit_raw

get_eip:
    pop eax
    jmp eax

 
die:
    mov dx, 0x3f8
    mov al, 'd'
    out dx, al
die_loop:
    hlt
    jmp die_loop


;;;;; Asembly words ;;;;;

%define last_word 0 ; link

%macro def_word 3
    entry_%1:
        dd last_word
        db %strlen(%2) | (%3 << 7) , %2
    body_%1:
    %define last_word entry_%1
%endmacro


def_word abort, "abort", 0  ; ( i*x -- ) r:( j*x -- )
    mov ebp, d_stack_base - 4   ; Reset data stack
    jmp body_quit


def_word quit, "quit", 0        ; ( -- ) r:( i*x -- )
    mov esp, 0x80000            ; Reset return stack
    mov dword [state], 0
    jmp body_repl


def_word repl, "repl", 0 ; ( -- )
    jmp die

times body_repl - $ + 5 db 0


not_found_str:
    db "Undefined word: "
    %assign not_found_str_len %strlen("Undefined word: ")


def_word undefined_error, "undefined-error", 0 ; ( addr u -- quit )
    call body_nl
    pushd
    pushd not_found_str
    mov eax, not_found_str_len
    call body_type
    call body_type
    call body_nl
    jmp body_quit


def_word parse_eval, "parse-eval", 0 ; ( i*x -- j*x ) consumes parse area
    pushd
    mov eax, 0x20
    call body_consume
    mov ebx, [source_ptr]
    cmp ebx, [source_len]
    jb .no_return
    ret

.no_return:         ; nothing
    pushd
    mov eax, 0x20
    call body_parse_until
    call body_find
    cmp eax, 0
    jg .immediate
    jl .non_immediate

.not_found:         ; addr u 0
    popd
    call body_to_number
    cmp eax, 0
    je .invalid_token
    
.a_number:          ; n true
    popd
    cmp dword [state], 0
    je body_parse_eval

.compile_number:    ; n
    call body_literal
    jmp body_parse_eval

.invalid_token:     ; addr u 0
    popd
    jmp body_undefined_error

.non_immediate:     ; xt -1
    cmp dword [state], 0
    je .immediate

.compile_xt:        ; xt -1
    popd
    call body_compile
    jmp body_parse_eval

.immediate:         ; xt 1|-1
    popd
    mov ebx, eax
    popd
    call ebx
    jmp body_parse_eval


def_word execute, "execute", 0 ; ( i*x xt -- j*x )
    mov ebx, eax
    popd
    jmp ebx


def_word consume, "consume", 0 ; ( c -- )
    mov ecx, [source_len]
    sub ecx, [source_ptr]
    jecxz .return
    mov ebx, [source]
    add ebx, [source_ptr]

.loop:
    mov dl, [ebx]
    inc ebx
    cmp dl, al
    jne .found
    loop .loop
    inc ebx

.found:
    dec ebx
    sub ebx, [source]
    mov [source_ptr], ebx

.return:
    popd
    ret


def_word parse_until, "parse-until", 0 ; ( c -- addr u )
    mov ecx, [source_len]
    sub ecx, [source_ptr]
    mov ebx, [source]
    add ebx, [source_ptr]
    pushd ebx
    jecxz .out_of_source

.loop:
    mov dl, [ebx]
    inc ebx
    cmp dl, al
    je .delimiter
    loop .loop

.out_of_source:
    sub ebx, [source]
    mov eax, ebx
    sub eax, [source_ptr]
    mov [source_ptr], ebx
    ret

.delimiter:
    sub ebx, [source]
    mov eax, ebx
    sub eax, [source_ptr]
    dec eax
    mov [source_ptr], ebx
    ret


def_word parse_name, "parse-name", 0 ; ( -- addr u )
    pushd
    mov eax, 0x20
    call body_consume
    pushd
    mov eax, 0x20
    jmp body_parse_until


def_word source, "source", 0 ; ( -- addr u )
    mov [ebp+4], eax
    mov eax, [source]
    mov [ebp+8], eax
    add ebp, 8
    mov eax, [source_len]
    ret


def_word source_addr, "source-addr", 0 ; ( -- addr )
    call variable

source:     dd forth_kernel


def_word source_len, "source-len", 0 ; ( -- addr )
    call variable

source_len: dd forth_kernel_end - forth_kernel


def_word source_ptr, ">in", 0 ; ( -- addr )
    call variable

source_ptr: dd 0


def_word source_id, "source-id", 0 ; ( -- addr )
    call variable

source_id: dd -1


def_word literal, "literal", 0 ; ( x -- ) compiles: ( -- x )
    mov edx, [here]
    comma 0xe8, 1
    mov ebx, literal
    sub ebx, edx
    sub ebx, 4
    comma ebx
    comma
    mov [here], edx
    popd
    ret

literal:
    pushd
    pop ebx
    mov eax, [ebx]
    add ebx, 4
    jmp ebx

    
def_word find, "find", 0 ; ( addr u -- addr u 0 | xt 1 | xt -1 )
    popd ebx
    mov edx, [latest]
    
.loop:
    mov cl, [edx+4]
    and ecx, 0x7f
    cmp eax, ecx            ; Compare lengths
    jne .skip

    mov esi, edx
    mov edi, ebx
    add esi, 5
    repz cmpsb
    jz .found

.skip:
    mov edx, [edx]
    cmp edx, 0
    jne .loop

.not_found:
    pushd ebx
    pushd
    mov eax, 0
    ret

.found:
    pushd esi
    mov eax, [edx+4]
    and eax, 0x80
    shr eax, 6
    dec eax
    ret


def_word nl, "nl", 0 ; ( -- )
    pushd
    mov eax, [cursor]
    mov cl, VGA_WIDTH
    div cl
    inc al
    mul cl
    mov [cursor], eax
    call scroll_to_cursor
    call update_cursor
    popd
    ret


def_word sp, "sp", 0 ; ( -- )
    pushd
    mov eax, 32
    or eax, [color]
    call emit_raw
    call update_cursor
    popd
    ret


def_word bsp, "bsp", 0 ; ( -- )
    mov ebx, [cursor]
    dec ebx
    mov ecx, [color]
    or ecx, 0x20
    mov [VGA_START+ebx*2], cx
    mov [cursor], ebx
    pushd
    call update_cursor
    popd
    ret


def_word color, "color", 0 ; ( -- addr )
    call variable

color: dd 0xf00


def_word cursor, "cursor", 0 ; ( -- addr )
    call variable

cursor: dd 0x00


def_word update_cursor, "update-cursor", 0 ; ( -- )
    push eax
    call update_cursor
    pop eax
    ret


def_word emit, "emit", 0 ; ( c -- )
    or eax, [color]
    call emit_raw
    call update_cursor
    popd
    ret


def_word type, "type", 0 ; ( addr u -- )
    mov ecx, eax
    popd ebx
    mov edx, [color]
    cmp ecx, 0
    je .no_type_loop

.type_loop:
    mov al, [ebx]
    mov ah, dh
    push ebx
    push ecx
    call emit_raw
    pop ecx
    pop ebx
    inc ebx
    loop .type_loop

.no_type_loop:
    call update_cursor
    popd
    ret
    

def_word in, "in", 0 ; ( port -- x ) TODO: delet dis?
    mov edx, eax
    in eax, dx
    ret


def_word out, "out", 0 ; ( x port -- ) TODO: delet dis?
    mov edx, eax
    popd
    out dx, eax
    popd
    ret
    

def_word compile, "compile,", 0 ; ( xt -- ) compiles: execution of xt
    mov edx, [here]
    comma 0xe8, 1
    sub eax, edx
    sub eax, 4
    comma
    mov [here], edx
    popd
    ret


def_word allot, "allot", 0 ; ( n -- )
    add [here], eax
    popd
    ret


sectors:    db 0
heads:      db 0 ; Actually one less
cylinders:  dw 0 ; Actually one less


def_word disk_info, "disk-info", 0 ; ( -- cylinders heads sectors )
    pushd
    movzx eax, word [cylinders]
    pushd
    movzx eax, byte [heads]
    pushd
    movzx eax, byte [sectors]
    ret


def_word max_block, "max-block", 0 ; ( -- block )
    pushd
    movzx eax, byte [heads]
    inc eax
    movzx edx, byte [sectors]
    mul edx
    movzx edx, word [cylinders]
    inc edx
    mul edx
    shr eax, 1
    dec eax
    ret


def_word fetch_sector, "fetch-sector", 0 ; ( sector buffer -- )
    popd ecx
    mov esi, eax
    mov eax, ecx
    mov edx, 0
    movzx ebx, byte [sectors]
    div ebx
    mov cl, dl
    inc cl
    mov edx, 0
    movzx ebx, byte [heads]
    inc ebx
    div ebx
    mov ebx, esi
    mov dh, dl
    mov ch, al
    shl al, 6
    or cl, al
    pushd esp
    cli
    lgdt [gdtr16]
    jmp 8:.bits_16

.bits_16:
    bits 16
    mov ax, 16
    mov ds, ax
    mov es, ax
    mov ss, ax
    mov eax, cr0
    and al, 0xfe
    mov cr0, eax
    jmp 0:.bios

.bios:
    mov ax, 0
    mov ds, ax
    mov es, ax
    mov ss, ax
    mov sp, 0x8000
    lidt [idtr16]
    sti

    mov ah, 0x02        ; Function: Read Sectors From Drive
    mov al, 1           ; !! sector count !!
    mov dl, [disk_id_something]
    int 0x13

    cli
    lgdt [gdtr]
    mov eax, cr0
    or al, 1
    mov cr0, eax
    jmp 8:.no_bios

.no_bios:
    bits 32
    mov ax, 16
    mov ds, ax
    mov es, ax
    mov ss, ax
    popd esp
    lidt [idtr]
    call program_pci
    in al, 0x60
    sti
    popd
    ret


def_word fetch, "fetch", 0 ; ( block addr -- )
    push eax
    popd
    add eax, eax
    pushd

    pushd
    mov eax, disk_buf
    call body_fetch_sector

    inc eax
    pushd
    mov eax, disk_buf+0x200
    call body_fetch_sector

    pushd
    pushd disk_buf
    pop eax
    pushd
    mov eax, 0x400
    jmp body_move


def_word disk_buf, "disk-buf", 0
    call variable

disk_buf: times 1024 db 0


def_word to_r, ">r", 0 ; ( x -- ) r:( -- x )
