def_word to_number, ">number", 0 ; ( addr u -- addr u 0 | n -1 )
    pushd
    mov ecx, eax
    jecxz .fail
    mov ebx, [ebp-4]
    mov eax, 0
    mov esi, [base]

    ; TODO: base prefixes

.char_check:
    mov edx, 0
    mov dl, [ebx]
    cmp dl, "'"
    jne .sign_check

.char:
    dec ecx
    jecxz .fail
    inc ebx
    popd ecx
    mov al, [ebx]
    mov [ebp], eax
    mov eax, -1
    ret

.sign_check:
    mov edi, 0
    mov dl, [ebx]
    cmp dl, '-'
    jne .loop
    mov edi, 0xffffffff
    inc ebx
    dec ecx
    jecxz .fail

.loop:
    mul esi
    mov edx, 0
    mov dl, [ebx]
    inc ebx
    sub dl, 0x30
    cmp dl, 0x11
    jb .adjusted
    sub dl, 0x7
    cmp dl, 0x2a
    jb .adjusted
    sub dl, 0x5

.adjusted:
    cmp edx, esi
    jae .fail
    add eax, edx
    loop .loop

.complete:
    add eax, edi
    xor eax, edi
    sub ebp, 8
    pushd
    mov eax, -1
    ret

.fail:
    mov eax, 0
    ret


