def_word create_helper, "(create)", 0 ; ( "<name>" -- ) creates entry
    call body_parse_name
    cmp eax, 64
    ja .name_too_long
    cmp eax, 0
    je .name_too_short

    mov edx, [here]
    mov [shadow], edx
    mov ebx, [latest]
    comma ebx           ; Link
    comma al, 1         ; Name length
    mov ecx, eax
    popd esi
    mov edi, edx
    rep movsb           ; Name
    mov [current], edi
    mov [here], edi
    popd
    ret
    
