    ; Bad apple
    ; Need to cut 10 chars from each side to get 480x360
    ; Each char is 8 video px wide
    ; Each char is 14.4 video px tall
    ; Each quarter is 4 video px wide and 7.2 video px tall
    ; Nth quarter is between 7.2*n and 7.2*(n+1) meaning that it takes
    ; px[fl(low)] * (cl(low) - low)
    ; + sum(px[cl(low), fl(high)])
    ; + px[fl(high)] * (high - fl(high))
    db "34 43 out 5D 40 out 9B 40 out ( set counter to 60 TPS ) "
    
    db ": next-frame ( -- ) begin timer-counter @ 0= while halt repeat "
    db   "0 timer-counter ! ; "

    db ": clear-screen ( -- ) 0 cursor ! update-cursor ; "

    db ": filled-buf: ( x -- ) create: FA0 0 do dup , 4 +loop drop ; "

    db "0F200F20 filled-buf: empty-buf "

    db ": save-screen ( addr -- ) vga swap FA0 move ; "
    db ": restore-screen ( addr -- ) vga FA0 move ; "

    db ": clear-screen ( -- ) empty-buf restore-screen "
    db   "0 cursor ! update-cursor ; "

    db ": play-video ( addr u -- ) clear-screen over + swap vga 2 - -rot ?do "
    db   "i c@ if i c@ 2 * + i 1 + c@ over c! 2 "
    db   "else drop vga 2 - 1 next-frame then +loop ; "

    db ": dump ( addr -- ) dup 400 + swap do nl i dup 40 + swap do i c@ emit "
    db   "loop 40 +loop ; "

    db ": fetch-many ( block addr n -- ) 0 ?do over i + over i 400 * + fetch "
    db   "loop 2drop ; "

